import React from 'react';
import './App.css';

class ForecastTwo extends React.Component{
    render(){
            const itemOne="5 items";
            const itemTwo="10 items";
            const day="Fri";
            const time="10:00";
            const high="19 c";
            const low="8 c";
        return(
            <div>
              <div className="weather-forecast__row">
                <span className="weather-forecast__day">Fri</span>
                <span className="weather-forecast__icon">
                  <i className="fa fa-clock-o"></i> 10:00
                </span>
                <span className="weather-forecast__high">19 c</span>
                <span className="weather-forecast__low">8 c</span>
              </div>
            </div>
        )
    }
}

export default ForecastTwo;
